import React, { Component } from 'react';
import {NavLink} from 'react-router-dom'
import prana from "../pictures/prana.jpg"
import satya  from "../pictures/satya.jpg"
import sontosha from "../pictures/santosha.jpg"
import asteya from "../pictures/asteya.jpg"

class Navigation2 extends Component {
  render() {
    console.log()
    return (
      <div className="linksContainer">

      <NavLink className="linkStyle"  to="/Pranyama"><img className="linkStyle" src={prana} /></NavLink><br/>
        <NavLink className="linkStyle"  to="/Yama2">Satva</NavLink> <br/>
        <NavLink className="linkStyle"  to="/Yama3">Asteya</NavLink><br/>
        <NavLink className="linkStyle"  to="/Niyama2">Santosha</NavLink><br/>
      </div>
    );
  }
}

export default Navigation2;
